import { MenuList } from "./components/MenuList/MenuList";
import s from "./style.module.css";

export function App() {
  return (
    <div>
    h2
      <h3>Select your React difficulty</h3>
      <div className={s.workspace}>
        <MenuList></MenuList>
        <DisplayDifficulty difficulty="Low"></DisplayDifficulty>
      </div>
    </div>
  );
}
